import jsPDF from "jspdf";
(function (jsPDFAPI) {
  var font =
    "";
  var callAddFont = function () {
    this.addFileToVFS("trado-normal.ttf", font);
    this.addFont("trado-normal.ttf", "trado", "normal");
  };
  var callSetFont = function () {
    this.setFont("trado");
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
  jsPDFAPI.events.push(["setFonts", callSetFont]);
})(jsPDF.API);
